import React from 'react';
import styles from './nav.css';

class Nav extends React.Component {

  render() {
    const btnText = this.props.view === 'new' ? 'View Saved Sessions' : 'Create New Session';
    return(
      <div className="row align-items-center nav-container">
        <div className="col-4">
          <div className="nav-username">{this.props.username}</div>
        </div>
        <div className="col-4 no-padding">
          <button className="btn btn-primary btn-block btn-app-secondary" onClick={this.props.onViewChange}>
            {btnText}
          </button>
        </div>
        <div className="col-4"></div>
      </div>
    )
  }

}

export default Nav;
